00a\u0020\u0020\u0072\u0065\u0074\u0075\u0072\u006e\u0020\u0063\u006f\u0075\u006e\u0074\u0020\u0021\u003d\u003d\u0020\u0072\u0061\u0079\u0073\u002e\u006c\u0065\u006e\u0067\u0074\u0068\u003b\u000a\u007d\u000a\u000a\u000a\u0066\u0075\u006e\u0063\u0074\u0069\u006f\u006e\u0020\u0052\u0061\u0079\u0028\u0072\u006f\u0077\u002c\u0020\u0063\u006f\u006c\u002c\u0020\u0066\u0029\u0020\u007b\u000a\u0020\u0020\u0074\u0068\u0069\u0073\u002e\u0063\u006f\u006c\u0020\u003d\u0020\u0063\u006f\u006c\u003b\u000a\u0020\u0020\u0074\u0068\u0069\u0073\u002e\u0072\u006f\u0077\u0020\u003d\u0020\u0072\u006f\u0077\u003b\u000a\u000a\u0020\u0020\u0076\u0061\u0072\u0020\u0078\u0070\u0020\u003d\u0020\u0073\u0078\u0020\u002b\u0020\u0063\u006f\u006c\u003b\u000a\u0020\u0020\u0076\u0061\u0072\u0020\u0079\u0070\u0020\u003d\u0020\u0073\u0079\u0020\u002b\u0020\u0072\u006f\u0077\u003b\u000a\u0020\u0020\u0076\u0061\u0072\u0020\u0066\u0069\u006c\u006c\u0020\u003d\u0020\u0066\u003b\u000a\u000a\u0020\u0020\u0076\u0061\u0072\u0020\u0061\u0074\u0068\u0020\u003d\u0020\u0074\u0078\u0074\u0048\u0020\u002f\u0020\u0031\u002e\u0035\u003b\u000a\u000a\u0020\u0020\u0076\u0061\u0072\u0020\u0061\u0020\u003d\u0020\u0070\u0069\u0032\u0020\u002a\u0020\u0028\u0074\u0068\u0069\u0073\u002e\u0072\u006f\u0077\u0020\u002d\u0020\u0061\u0074\u0068\u0020\u002a\u0020\u002e\u0035\u0029\u0020\u002f\u0020\u0061\u0074\u0068\u003b\u000a\u0020\u0020\u0069\u0066\u0020\u0028\u0061\u0020\u003d\u003d\u003d\u0020\u0030\u0029\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0061\u0020\u003d\u0020\u0028\u004d\u0061\u0074\u0068\u002e\u0072\u0061\u006e\u0064\u006f\u006d\u0028\u0029\u0020\u002d\u0020\u002e\u0035\u0029\u0020\u002a\u0020\u0070\u0069\u0032\u003b\u000a\u0020\u0020\u007d\u000a\u0020\u0020\u0076\u0061\u0072\u0020\u0064\u0061\u0020\u003d\u0020\u002e\u0030\u0032\u0020\u002a\u0020\u004d\u0061\u0074\u0068\u002e\u0073\u0069\u0067\u006e\u0028\u0061\u0029\u003b\u000a\u000a\u0020\u0020\u0076\u0061\u0072\u0020\u0071\u0020\u003d\u0020\u0032\u0020\u002a\u002
